ISLAMABAD, Oct 14 (APP): Special Assistant to Prime Minister on Parliamentary Coordination Nadeem Afzal Gondal and Senator Anwarul Haq Kakar from Balochistan Wednesday called on Prime Minister Imran Khan here.
During the meeting, they discussed the matters pertaining to the politics and development of their respective areas.
